import { Routes, Route } from "react-router";

import Home from "./routes/home/home.component";

const Shop = () => {
  return <h1>I am the shope page</h1>
}

const App = () => {
  return ( 
    <Routes>
      <Route path='/home' element={<Home />}>
         <Route path='/shop' element={<Shop />} />  
         </Route>
       <Route/>
    </Routes>
  );
};


export default App;
